import React from "react";

const Seach = ({search, setSearch}) => (
    <div className="search">
        <h2>Pesquisar:</h2>
        <input 
          type="text" 
          value={search} 
          onChange={(e) => setSearch(e.target.value)}
          placeholder="Digite qual tarefa deseja pesquisar..."
        />
    </div>
);


export default Search;
